import "./global.css";
import s from "./style.module.css";

export function App() {
  return (
    <div className={s.main_container}>
      <div className={s.header}>
        <div className="row">
          <div className="col-4"></div>
          <div className="col-4">
            {" "}
            <input type="text" />
          </div>
        </div>
      </div>
      <div className={s.tv_show_detail}>Detail</div>
      <div className={s.recommandations}>Recommendations</div>
    </div>
  );
}
